export async function loadContributors() {
  const url = "https://www.api.github.com/users/gemmas95/repos";
  const url2 =
    "https://www.api.github.com/repos/gemmas95/skylab-bootcamp-202008/collaborators";
  const response = await fetch(url2);
  const contributors = await response.json();
  console.log(contributors);
  return contributors;
}
